webpackJsonp([0x8914c5b895c5],{479:function(e,t){e.exports={data:{markdownRemark:{html:"<p>I'm just going to store this here for my personal usage...</p>\n<h2>Reset</h2>\n<p>Resets state of branch to origin/branch. The <code>--hard</code> option throws away any changes, <code>--soft</code> only moves HEAD, keeping the changes.</p>\n<p><code>git reset --hard origin/mybranch</code></p>\n<h2>Revert</h2>\n<p>Reverts certain commit. Allows saving \"revert\" as separate commit which keeps the changes it in the history. The <code>-m</code> option specifies which side of merge should be kept. 1 means parent branch (So for example if you want to revert feature branch merge into develop then 1 is keep develop changes).</p>\n<p><code>git revert -m 1 commithash</code></p>\n<p>Reverting last commit</p>\n<p><code>git revert HEAD</code></p>\n<h2>Rebase</h2>\n<p>Resolves conflicts by rebasing branch onto another branch. Has <code>-i</code> option which enters interactive mode that allows editing commit messages, squashing commits and other stuff.</p>\n<p><code>git rebase -i develop</code></p>\n<h2>Push -u</h2>\n<p>When working on branch that doesn't have an upstream branch things can be made quicker with this command. Creates upstream branch with same name and pushes the changes into it.</p>\n<p><code>git push -u</code></p>\n<p>Must have <code>pust.default current</code> option set</p>\n<p><code>git config --global push.default current</code></p>",id:"/Users/martinvich/repos/blog/src/pages/posts/advanced-git-commands.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Advanced git commands",date:"December 02, 2018",path:"/advanced-git-commands",tags:["Git"]}}},pathContext:{siteTitle:"Martin VÃ­ch's blog",pathValue:"/advanced-git-commands"}}}});
